import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

import AddAirplaneForm from './components/AddAirplaneForm';
import ViewAirplanes   from './components/ViewAirplanes';

import AddAirportForm  from './components/AddAirportForm';
import ViewAirports    from './components/ViewAirports';

import AddPersonForm   from './components/AddPersonForm';
import ViewPersons     from './components/ViewPersons';

export default function App() {
  return (
    <BrowserRouter>
      {/* ─────── Navigation Bar ─────── */}
      <nav style={{ padding: '1rem', borderBottom: '1px solid #ddd' }}>
        <Link to="/"               style={{ marginRight: '1rem' }}>Home</Link>

        {/* Airplanes */}
        <Link to="/add-airplane"   style={{ marginRight: '0.5rem' }}>Add Airplane</Link>
        <Link to="/view-airplanes" style={{ marginRight: '1rem' }}>View Airplanes</Link>

        {/* Airports */}
        <Link to="/add-airport"    style={{ marginRight: '0.5rem' }}>Add Airport</Link>
        <Link to="/view-airports"  style={{ marginRight: '1rem' }}>View Airports</Link>

        {/* People */}
        <Link to="/add-person"     style={{ marginRight: '0.5rem' }}>Add Person</Link>
        <Link to="/view-persons">View People</Link>
      </nav>

      {/* ─────── Routes ─────── */}
      <Routes>
        <Route path="/" element={<p style={{ padding: '2rem' }}>Select an action from the navigation bar.</p>} />

        {/* Airplanes */}
        <Route path="/add-airplane"   element={<AddAirplaneForm />} />
        <Route path="/view-airplanes" element={<ViewAirplanes   />} />

        {/* Airports */}
        <Route path="/add-airport"    element={<AddAirportForm  />} />
        <Route path="/view-airports"  element={<ViewAirports    />} />

        {/* People */}
        <Route path="/add-person"     element={<AddPersonForm   />} />
        <Route path="/view-persons"   element={<ViewPersons     />} />

        {/* Fallback */}
        <Route path="*" element={<p style={{ padding: '2rem' }}>Page not found.</p>} />
      </Routes>
    </BrowserRouter>
  );
}
